sys_variable_value.value:
(function execute(inputs, outputs) {

    var input_json = inputs.json;
    var delimiter_value = inputs.delimiter.toString().trim();
    var ledgerAccountArray = new sn_sap_data_int.IntegrationsUtils().parseExecuteRFC(input_json, delimiter_value);
    outputs.ledger_account = ledgerAccountArray.JSONOBJECT;
    outputs.total_rows = ledgerAccountArray.ROWCOUNT;

})(inputs, outputs);

